<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Qt 4 a évolué depuis 2005 et a fourni une base solide pour des milliers d'applications et même des systèmes complets de bureau et mobiles. Les habitudes d'utilisation des utilisateurs d'ordinateurs ont changé ces dernières années. Des PC fixes aux ordinateurs portables et aujourd'hui aux ordinateurs mobiles. Le bureau classique est de plus en plus remplacé par des écrans mobiles tactiles toujours connectés. Avec lui, les paradigmes UX du bureau changent également. Alors que dans le passé, l'interface utilisateur de Windows dominait le monde, nous passons aujourd'hui plus de temps sur d'autres écrans avec une autre langue d'interface utilisateur.

Qt 4 a été conçu pour satisfaire le monde des ordinateurs de bureau afin de disposer d'un ensemble cohérent de widgets d'interface utilisateur disponibles sur toutes les principales plates-formes. Le défi pour les utilisateurs de Qt a changé aujourd'hui et consiste davantage à fournir une interface utilisateur tactile pour une interface utilisateur axée sur le client et à permettre une interface utilisateur moderne sur tous les principaux systèmes de bureau et mobiles. Qt 4.7 a commencé à introduire la technologie <b>Qt Quick</b> qui permet aux utilisateurs de créer un ensemble de composants d'interface utilisateur à partir d'éléments simples pour obtenir une toute nouvelle interface utilisateur, pilotée par les demandes des clients.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
