<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation du programme principale:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
int GWindowRun(int _argc, char** _argv) {
    QGuiApplication lApp(_argc, _argv);

    QQmlApplicationEngine engine;
    const QUrl url(QStringLiteral("qrc:/qml/window.qml"));
    QObject::connect(&amp;engine
            , &amp;QQmlApplicationEngine::objectCreated
            , &amp;lApp
            , [url](QObject *obj, const QUrl &amp;objUrl) {
            if (!obj &amp;&amp; url == objUrl)
                QCoreApplication::exit(-1);
            }
            , Qt::QueuedConnection);
    engine.load(url);

    lApp.exec();
}
//===============================================</pre><br>Implémentation de la fenêtre principale:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
}
//===============================================</pre><br></div>
