<h1 class="Section4">
<a class="Section5" href="#" id="changement-de-la-couleur-d-un-rectangle--mousearea-">Changement de la couleur d'un rectangle (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation de changement de la couleur:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
