    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        width: 100; height: 100
        color: "green"

        MouseArea {
            anchors.fill: parent
            onClicked: { parent.color = 'red' }
        }
    }
}
//===============================================</pre><br></div>
