</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="autorisation-du-clic-droit-de-la-souris--mousearea-">Autorisation du clic droit de la souris (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation de l'autorisation du clic droit de la souris:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        width: 100; height: 100
        color: "green"

        MouseArea {
            anchors.fill: parent
            acceptedButtons: Qt.LeftButton | Qt.RightButton
            onClicked: (mouse) =&gt; {
                if (mouse.button === Qt.RightButton)
                    parent.color = 'blue';
                else
                    parent.color = 'red';
            }
        }
    }
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="autorisation-de-tous-les-boutons-de-la-souris--mousearea-">Autorisation de tous les boutons de la souris (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation de l'autorisation de tous les boutons:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        width: 100; height: 100
        color: "green"

        MouseArea {
            anchors.fill: parent
            acceptedButtons: Qt.AllButtons
            onClicked: (mouse) =&gt; {
                if (mouse.button === Qt.RightButton)
                    parent.color = 'blue';
                else if(mouse.button === Qt.MiddleButton)
                    parent.color = 'yellow';
                else
                    parent.color = 'red';
            }
        }
    }
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="changement-de-la-forme-du-curseur--mousearea-">Changement de la forme du curseur (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation du changement de la forme du curseur:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        width: 100; height: 100
        color: "green"

        MouseArea {
            anchors.fill: parent
            cursorShape: Qt.PointingHandCursor
            acceptedButtons: Qt.AllButtons
            onClicked: (mouse) =&gt; {
                if (mouse.button === Qt.RightButton)
                    parent.color = 'blue';
                else if(mouse.button === Qt.MiddleButton)
                    parent.color = 'yellow';
                else
                    parent.color = 'red';
            }
        }
    }
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="deplacement-d-un-rectangle-suivant-x--mousearea-">Déplacement d'un rectangle suivant x (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation du déplacement du rectangle suivant x:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        id: rect
        width: 50; height: 50
        color: "red"
        opacity: (300.0 - rect.x) / 300

        MouseArea {
            anchors.fill: parent
            drag.target: rect
            drag.axis: Drag.XAxis
            drag.minimumX: 0
            drag.maximumX: window.width - rect.width
        }
    }
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
