<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="deplacement-d-un-rectangle-a-partir-d-un-descendant--mousearea-">Déplacement d'un rectangle à partir d'un descendant (MouseArea)</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation du déplacement du rectangle à partir de son descendant:<br>&nbsp;&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
    Rectangle {
        x: 30; y: 30
        width: 100; height: 100
        color: "lightsteelblue"

        MouseArea {
            anchors.fill: parent
            drag.target: parent;
            drag.axis: "XAndYAxis"
            drag.minimumX: 30
            drag.maximumX: window.width - parent.width - 30
            drag.minimumY: 30
            drag.maximumY: window.height - parent.height - 30
            drag.filterChildren: true

            Rectangle {
                color: "yellow"
                x: 25; y : 25
                width: 50; height: 50
                MouseArea {
                    anchors.fill: parent
                    onClicked: console.log("Clicked")
                }
            }
        }
    }
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-un-gradient-vertical">Création d'un gradient vertical</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Implémentation du gradient vertical:<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import QtQuick
//===============================================
Window {
    id: window
    width: 300
    height: 300
    visible: true
    title: qsTr("ReadyApp")
    
	Rectangle {
	    width: 100; height: 100
	    gradient: Gradient {
	        GradientStop { position: 0.0; color: "red" }
	        GradientStop { position: 0.33; color: "yellow" }
	        GradientStop { position: 1.0; color: "green" }
	    }
	}
}
