<h1 class="Section4">
<a class="Section5" href="#" id="creation-de-nouveaux-types-qml">Création de nouveaux types QML</a>
</h1>
<div class="Section6"><br>Nous essayerons de créer un nouveau type qml (GPieChart) importé à partir d'un nouveau module (GCharts).<br><br>Dans le programme principal (main.cpp), on commence par charger le fichier qml principal (main.qml) à partir la ligne (9).<br><br>Programme principal (main.cpp):<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include &lt;QtQuick/QQuickView&gt;
#include &lt;QGuiApplication&gt;
//===============================================
int main(int _argc, char** _argv) {
    QGuiApplication app(_argc, _argv);
    QQuickView view;
    view.setResizeMode(QQuickView::SizeRootObjectToView);
    view.setSource(QUrl("qrc:/qml/main.qml"));
    view.show();
    return QGuiApplication::exec();
}
//===============================================</pre><br>Dans le fichier qml principal (main.qml), on importe le nouveau module (GCharts) à partir de la ligne (2) et on utilise le nouveau type (GPieChart) à partir des lignes (9-16).<br><br>Fichier qml principal (main.qml):<br><br><pre class="GCode1 Code1 AceCode" data-mode="qml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
import GCharts
import QtQuick
//===============================================
Item {
    width: 300
    height: 200

    GPieChart {
        id: aPieChart
        anchors.centerIn: parent
        width: 100
        height: 100
        name: "A simple pie chart"
        color: "red"
    }

    Text {
        anchors {
        	bottom: parent.bottom
        	horizontalCenter: parent.horizontalCenter
        	bottomMargin: 20
        }
        text: aPieChart.name
    }
}
//===============================================</pre><br>Dans le fichier header (GPieChart.h), on indique que la classe (GPieChart) est un élément qml grâce à la macro (QML_ELEMENT) à partir de la ligne (12). On expose aussi les propriétés nom (name) et couleur (color) de la classe (GPieChart) à partir des lignes (10-11) grâce à la macro (Q_PROPERTY). On indique également que la classe (GPieChart) est un QObject à partir de la ligne (9) grâce à la macro (Q_OBJECT).<br><br>Fichier header (GPieChart.h):<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#ifndef _GPieChart_
#define _GPieChart_
//===============================================
#include &lt;QtQuick/QQuickPaintedItem&gt;
#include &lt;QColor&gt;
//===============================================
class GPieChart : public QQuickPaintedItem {
    Q_OBJECT
    Q_PROPERTY(QString name READ name WRITE setName FINAL)
    Q_PROPERTY(QColor color READ color WRITE setColor FINAL)
    QML_ELEMENT

public:
    GPieChart(QQuickItem *parent = nullptr);

    QString name() const;
    void setName(const QString &amp;name);

    QColor color() const;
    void setColor(const QColor &amp;color);

    void paint(QPainter *painter) override;

private:
    QString m_name;
    QColor m_color;
};
//===============================================
#endif
//===============================================</pre><br>Dans le fichier source (GPieChart.cpp), on définit comment peindre l'objet (GPieChart) à partir des lignes (26-31) dans la méthode (paint). On initialise la couleur de contour de l'objet QPainter et on désigne une forme circulaire.<br><br>Fichier source (GPieChart.cpp):<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include "GPieChart.h"
#include &lt;QPainter&gt;
//===============================================
GPieChart::GPieChart(QQuickItem *parent)
: QQuickPaintedItem(parent) {

}
//===============================================
QString GPieChart::name() const {
    return m_name;
}
//===============================================
void GPieChart::setName(const QString &amp;name) {
    m_name = name;
}
//===============================================
QColor GPieChart::color() const {
    return m_color;
}
//===============================================
void GPieChart::setColor(const QColor &amp;color) {
    m_color = color;
}
//===============================================
void GPieChart::paint(QPainter *painter) {
    QPen pen(m_color, 2);
    painter-&gt;setPen(pen);
    painter-&gt;setRenderHints(QPainter::Antialiasing, true);
    painter-&gt;drawPie(boundingRect().adjusted(1, 1, -1, -1), 90 * 16, 290 * 16);
}
//===============================================</pre><br>Dans le fichier projet (GProject.pro), on indique au compilateur qu'on va créer de nouveaux types qml grâce à l'opérateur (qmltypes) à partir de la ligne (11). On indique le nom du nouveau module qml  (GCharts) grâce à l'opérateur (QML_IMPORT_NAME) associé aux nouveaux types à partir de la ligne (12). On indique la version du nouveau module (1) grâce à l'opérateur (QML_IMPORT_MAJOR_VERSION) à partir de la ligne (13). On indique qu'on va utiliser les modules (QtQml, QtQuick) grâce aux opérateurs (qml, quick) à partir de la ligne (9).<br><br>Fichier projet (GProject.pro):<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">TEMPLATE = app
TARGET = rdv_cpp
DESTDIR = bin
OBJECTS_DIR = build
MOC_DIR = build
UI_DIR = build
RCC_DIR = build
CONFIG += gnu++11
QT += qml quick

CONFIG += qmltypes
QML_IMPORT_NAME = GCharts
QML_IMPORT_MAJOR_VERSION = 1

SOURCES +=\
    main.cpp \
    GPieChart.cpp \

HEADERS +=\
    GPieChart.h \
    
RESOURCES +=\
	resources.qrc \</pre><br>Compilation:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">qmake
